import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const App = () => {
  return (
    <>
      <h1 className="heading">The List of Top 5 Netflix Series</h1>

      <Card
        imgscr={Sdata[0].imgsrc}
        des={Sdata[0].des}
        title={Sdata[0].title}
        link={Sdata[0].link}
      />
      <Card
        imgscr={Sdata[1].imgsrc}
        des={Sdata[1].des}
        title={Sdata[1].title}
        link={Sdata[1].link}
      />
      <Card
        imgscr={Sdata[2].imgsrc}
        des={Sdata[2].des}
        title={Sdata[2].title}
        link={Sdata[2].link}
      />
      <Card
        imgscr={Sdata[3].imgsrc}
        des={Sdata[3].des}
        title={Sdata[3].title}
        link={Sdata[3].link}
      />
      <Card
        imgscr="https://picsum.photos/250/300"
        des="A Original Netflix Series"
        title="Dark"
        link="https://www.google.com"
      />
      <Card
        imgscr="https://picsum.photos/250/300"
        des="A Original Netflix Series"
        title="Dark"
        link="https://www.google.com"
      />
    </>
  );
};

export default App;
